@use 'sass:map';

$flexmap: (
  start: flex-start,
  end: flex-end,
  around: space-around,
  between: space-between,
  evenly: space-evenly,
  stretch: stretch,
  center: center,
);

@function get-flex-value($key) {
  @return map.get($flexmap, $key);
}

@mixin flexbox($display: flex, $jc: center, $ai: center) {
  display: $display;
  justify-content: get-flex-value($jc);
  align-items: get-flex-value($ai);
}

sources.styles/mixins/_position.scss:
@mixin pos-center-x($type: absolute) {
  @if ($type == absolute or $type: fixed) {
    position: $type;
    left: 50%;
    transform: translateX(-50%);
  }
}

@mixin pos-center-y($type: absolute) {
  @if ($type == absolute or $type: fixed) {
    position: $type;
    top: 50%;
    transform: translateY(-50%);
  }
}

@mixin pos-center($type: absolute) {
  @if ($type == absolute or $type: fixed) {
    position: $type;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
  }
}

