sources.styles/components/_footer.scss:
.footer {
  margin-top: $grid__gutter;
  background-color: $white--txt;
  padding: $global--pd $footer--pd;

  .list__group {
    .title {
      @include flexbox($jc: between);
      @include font($sz: 11px, $lh: 1.3);
      padding: $global__inner--pd 0;
      border-bottom: 1px solid $border;
      cursor: pointer;

      &::after {
        content: "+";
        margin-right: 8px;
      }
    }
  }

  .advice__help {
    @include font($sz: 11px, $lh: 1.3, $color: $tertiary);
    margin: $global--pd 0;
  }

  &__info {
    @include font($sz: 11px, $color: $secondary);

    .location {
      margin: $global--pd 0;
    }

    .copyright,
    .corps {
      color: $gray;
    }

    .legal {
      padding: $footer__inner--pd 0;
      a {
        position: relative;
        padding-left: $footer__inner--pd;
        padding-right: $footer__inner--pd + $inline--gap;

        &:first-child {
          padding-left: 0;
        }
        &:not(:last-child)::after {
          position: absolute;
          right: 0;
          content: "";
          width: 1px;
          height: 100%;
          background-color: $border;
        }
      }
    }

    .corps {
      dt:not(:first-child) {
        padding-left: $footer__inner--pd;
      }
      dd {
        position: relative;
        padding-right: $footer__inner--pd + $inline--gap;

        &:not(:last-child)::after {
          position: absolute;
          right: 0;
          content: "";
          width: 1px;
          height: 100%;
          background-color: $border;
        }

        a {
          color: $secondary;
        }
      }
    }
  }
}

sources.styles/components/_footer--md.scss:
.footer {
  @include responsive(md) {
    &--wrapper {
      max-width: $footer__max-h;
      margin: 0 auto;
    }
    .list__group {
      @include flexbox($ai: start);

      &__item {
        flex-basis: calc(100% / #{$footer__columns--md});

        article:nth-child(2) {
          padding-top: $footer--pd--md;
        }

        .title {
          font-weight: 500;
          padding-top: 0;
          border-bottom: none;

          &::after {
            display: none;
          }
        }
        ul {
          @include font($sz: 11px, $lh: 1.3, $fw: 300, $color: $secondary);

          li {
            a {
              display: block;
              padding: $footer__inner--pd 0;
            }
          }
        }
      }
    }

    .advice__help {
      margin: 0;
      padding-bottom: $global__inner--pd;
      border-bottom: 1px solid $border;
    }

    &__info {
      .flex-area {
        @include flexbox($jc: between);
        flex-direction: row-reverse;

        &--left {
          p {
            display: inline-block;
          }
        }
      }
    }
  }
}
